script: |
  super -f text -I q11120.spq | sort > q11120.out

inputs:
  - name: q11120.spq
    data: |
      SELECT DISTINCT - col0 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + 10 * + - col1 / + - CAST ( + ( + col1 ) AS REAL ) + - col0 IS NOT NULL;
  - name: tab0

outputs:
  - name: q11120.out
    data: |
